                    <input type="text" name="fName" id="fName" placeholder="Vorname" class="w-full rounded-md border border-[#e0e0e0] bg-white py-3 px-6 text-base font-medium text-[#6B7280] outline-none focus:border-[#6A64F1] focus:shadow-md"/>
                </form>
                <form class=" ">
                    <label for="lName" class="mb-3 block text-base font-medium">
                        Nachname
                    </label>
                    <input type="text" name="lName" id="lName" placeholder="Nachname" class="w-full rounded-md border border-[#e0e0e0] bg-white py-3 px-6 text-base font-medium text-[#6B7280] outline-none focus:border-[#6A64F1] focus:shadow-md"/>
                </form>
            </div>
        </div>


        )
    }
}

export default Booking;
